        address={data.content.address_name}
        title={data.content.place_name}
        desc={data.content.category_name}
        url={data.content.place_url}
        img={"https://picsum.photos/200"}
        imgWidth={70}
        padding={""}
        // onClick={() => onClick(data.content)}
      />
  );
}
